import React from 'react';
import { Link } from 'react-router-dom';
import './Navbar.css'; // 引入 CSS 文件

const Navbar = () => {
  return (
    <div
      style={{
        position: 'absolute',
        width: '1280px',
        height: '100px',
        top: 0,
        left: '200px'
      }}
    >
      {/* Quiz 链接 */}
      <Link
        to="/quiz"
        className="nav-link"
        style={{
          position: 'absolute',
          width: 'fit-content',
          height: '30px',
          left: '766px',
          top: '63px',
          textAlign: 'center',
          color: 'white',
          fontSize: '30px',
          fontFamily: 'rl-aqva, sans-serif',
          fontWeight: 900,
        }}
      >
        Quiz!
      </Link>

      {/* Personality Types 链接 */}
      <Link
        to="/personality"
        className="nav-link"
        style={{
          position: 'absolute',
          width: 'fit-content',
          height: '30px',
          left: '872px',
          top: '63px',
          textAlign: 'center',
          color: 'white',
          fontSize: '30px',
          fontFamily: 'rl-aqva, sans-serif',
          fontWeight: 900,
          wordWrap: 'break-word'
        }}
      >
        Personality Types
      </Link>

      {/* About 链接 */}
      <Link
        to="/about"
        className="nav-link"
        style={{
          position: 'absolute',
          width: 'fit-content',
          height: '30px',
          left: '1155px',
          top: '63px',
          textAlign: 'center',
          color: 'white',
          fontSize: '30px',
          fontFamily: 'rl-aqva, sans-serif',
          fontWeight: 900,
          wordWrap: 'break-word'
        }}
      >
        About
      </Link>
    </div>
  );
};

export default Navbar;
